import React from 'react';

class MusicCard extends React.Component {
  render() {
    const { musics } = this.props;

    return (
      <section id="tracksListContainer">
        {musics.map(({trackName, previewUrl})=> {
          <span>{trackName}</span>
        })}
      </section>
    );
  }
}

export default MusicCard;
